<a class="Title2" id="utilisation-de-google-fonts-v0_ce-qu-il-faut-savoir" href="#nettoyage-du-depot">Ce qu'il faut savoir</a>
</h2><br>Il faut que le répertoire d'installation soit à la racine de votre fichier d'entrée (index.html). Il faut charger la police dans une feuille de style (css.ss).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-google-fonts-v0_programme-principal" href="#nettoyage-du-depot">Programme principal</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="html" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">&lt;!DOCTYPE html&gt;
&lt;html lang="fr"&gt;
    &lt;head&gt;
        &lt;title&gt;GoogleFonts | ReadyDev&lt;/title&gt;
        &lt;link  rel="stylesheet" href="./libs/google_fonts/v0.3.8/Akronim/css.css"&gt;
        &lt;style&gt;
            .editor {
                border: 1px solid black;
                font-family: Akronim;
                font-size: 30px;
                display: inline-block;
                padding: 10px;
            }
        &lt;/style&gt;
    &lt;/head&gt;
    &lt;body&gt;
        &lt;div class="editor"&gt;Bonjour tout le monde.&lt;/div&gt;
    &lt;/body&gt;
&lt;/html&gt;</pre><br><h2 class="GTitle1 Title1">
